import React, {memo} from 'react';
import styled from 'styled-components';

import mq from '../style/MediaQuery';

const HeaderContainer = styled.div`
    width:100%;
    height:120px;
    background-color: #fff;
    display: flex;
    justify-content: center;
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <h1>Header</h1>
    </HeaderContainer>
  );
});

export default Header;
